// App.js
import './style/App.css';
import React, { useState } from 'react';
import { Canvas } from '@react-three/fiber';
import { OrbitControls } from '@react-three/drei';
import { BrowserRouter as Router, Route, Routes, useNavigate } from 'react-router-dom';
import Earth from './components/Earth';
import Home from './pages/Home';

const App = () => {
  const [clicked, setClicked] = useState(false);
  const navigate = useNavigate();

  const handleClick = () => {
    // Realiza la animación antes de redirigir
    setClicked(true);
    setTimeout(() => {
      navigate('/home');
    }, 3000); // Ajusta el tiempo según la duración de tu animación (en milisegundos)
  };

  return (
    <Router>
      <div className={`app-container ${clicked ? 'clicked' : ''}`}>
        <Canvas camera={{ position: [0, 0, 2] }}>
          <ambientLight />
          <pointLight position={[10, 10, 10]} />
          {!clicked && <Earth />}
          <OrbitControls enablePan={false} enableZoom={false} enableDamping dampingFactor={0.25} rotateSpeed={0.3} />
        </Canvas>
        <div className={`overlay ${clicked ? 'clicked' : ''}`} onClick={handleClick}>
          <div className="text">
            <span className="small">Diving</span>
            <span className="large">ES</span>
          </div>
        </div>
      </div>
      <Routes>
        <Route path="/home" element={<Home />} />
      </Routes>
    </Router>
  );
};

export default App;
